import React from 'react';
import image from './ClariPhoto.jpeg';
import './Home.css';
import { useNavigate } from "react-router-dom";
import { navigate } from '@reach/router';
function Home() {
  // let navigate = useNavigate();
  const navAbout = () =>{
    window.location.href = '/about'
  }
  const navContact = () =>{
    window.location.href = '/contact'
  }
  const navWork = () =>{
    window.location.href = '/mywork'
  }
  return (


    <div className='all'>
      {/* <h1>Home</h1> */}
      <br></br>
      <br></br>
    <div className='section1'>
        <img class="imag" src={image} />
            <div className='text'>
                <h1>Clarisa Carrillo</h1>
                <p>Emerson College '24</p>
            </div>


    </div>


    <div className='about' onClick={navAbout}>
        <h3>About Me</h3>
        <p>More about my background, including my education history</p>
    </div>

    <div className='section3' onClick={navWork}>
        <h3>My Work</h3>
        <p>A comprehensive portfolio including content creation, choreography, and papers</p>
    </div>

    <div className='section4' onClick={navContact}>
        <h3>Contact Me</h3>
        <p>Click here for my email, number, and socials</p>
    </div>


    <br></br><br></br>
    <div className='helper'></div>
    </div>
  );
}
export default Home;
